MongoDB aggregation, distinct several fields and count them<p>The best way I can describe what I want to achieve is using an example. Basically I would have a list of cars say: </p>

<pre><code>[
    {
        _id: 1,
        make: 'Toyota',
        model: 'Prius'
    },
    {
        _id: 2,
        make: 'Toyota',
        model: 'Prius'
    },
    {
        _id: 3,
        make: 'Toyota',
        model: 'Yaris'
    },
    {
        _id: 4,
        make: 'Lexus',
        model: 'RX400'
    }
]
</code></pre>

<p>And now I want to group/distinct them by <code>make</code> and <code>model</code> (and possibly more fields) and count the totals. The final result should look something like: </p>

<pre><code>{
    makes: [
        {
            name: 'Toyota',
            total: 3
        }, {
            name: 'Lexus',
            total: 1
        }
    ],
    models: [
        {
            name: 'Prius',
            total: 2
        },
        {
            name: 'Yaris',
            total: 1
        },
        {
            name: 'RX400',
            total: 1
        }
    ]
}
</code></pre>

<p>I'm completely stuck with this one. So far, the only way I can achieve this is by calling several async aggregation calls for each field. However, I would prefer to do it in a single aggregation call, if that is possible at all (unless it's not a good idea performance wise).</p>

